public class InnerDataSourceDataSourceParametersFactory(Action<Humidifier.QuickSight.DataSourceTypes.DataSourceParameters> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.DataSourceTypes.DataSourceParameters>
{

    internal InnerDataSourceAuroraPostgreSqlParametersFactory AuroraPostgreSqlParametersFactory { get; set; }

    internal InnerDataSourceTeradataParametersFactory TeradataParametersFactory { get; set; }

    internal InnerDataSourceRdsParametersFactory RdsParametersFactory { get; set; }

    internal InnerDataSourceAthenaParametersFactory AthenaParametersFactory { get; set; }

    internal InnerDataSourceSparkParametersFactory SparkParametersFactory { get; set; }

    internal InnerDataSourceMariaDbParametersFactory MariaDbParametersFactory { get; set; }

    internal InnerDataSourceOracleParametersFactory OracleParametersFactory { get; set; }

    internal InnerDataSourcePrestoParametersFactory PrestoParametersFactory { get; set; }

    internal InnerDataSourceStarburstParametersFactory StarburstParametersFactory { get; set; }

    internal InnerDataSourceRedshiftParametersFactory RedshiftParametersFactory { get; set; }

    internal InnerDataSourceMySqlParametersFactory MySqlParametersFactory { get; set; }

    internal InnerDataSourceSqlServerParametersFactory SqlServerParametersFactory { get; set; }

    internal InnerDataSourceSnowflakeParametersFactory SnowflakeParametersFactory { get; set; }

    internal InnerDataSourceAmazonElasticsearchParametersFactory AmazonElasticsearchParametersFactory { get; set; }

    internal InnerDataSourceAmazonOpenSearchParametersFactory AmazonOpenSearchParametersFactory { get; set; }

    internal InnerDataSourcePostgreSqlParametersFactory PostgreSqlParametersFactory { get; set; }

    internal InnerDataSourceAuroraParametersFactory AuroraParametersFactory { get; set; }

    internal InnerDataSourceS3ParametersFactory S3ParametersFactory { get; set; }

    internal InnerDataSourceTrinoParametersFactory TrinoParametersFactory { get; set; }

    internal InnerDataSourceDatabricksParametersFactory DatabricksParametersFactory { get; set; }

    protected override Humidifier.QuickSight.DataSourceTypes.DataSourceParameters Create()
    {
        var dataSourceParametersResult = CreateDataSourceParameters();
        factoryAction?.Invoke(dataSourceParametersResult);

        return dataSourceParametersResult;
    }

    private Humidifier.QuickSight.DataSourceTypes.DataSourceParameters CreateDataSourceParameters()
    {
        var dataSourceParametersResult = new Humidifier.QuickSight.DataSourceTypes.DataSourceParameters();

        return dataSourceParametersResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DataSourceTypes.DataSourceParameters result)
    {
        base.CreateChildren(result);

        result.AuroraPostgreSqlParameters ??= AuroraPostgreSqlParametersFactory?.Build();
        result.TeradataParameters ??= TeradataParametersFactory?.Build();
        result.RdsParameters ??= RdsParametersFactory?.Build();
        result.AthenaParameters ??= AthenaParametersFactory?.Build();
        result.SparkParameters ??= SparkParametersFactory?.Build();
        result.MariaDbParameters ??= MariaDbParametersFactory?.Build();
        result.OracleParameters ??= OracleParametersFactory?.Build();
        result.PrestoParameters ??= PrestoParametersFactory?.Build();
        result.StarburstParameters ??= StarburstParametersFactory?.Build();
        result.RedshiftParameters ??= RedshiftParametersFactory?.Build();
        result.MySqlParameters ??= MySqlParametersFactory?.Build();
        result.SqlServerParameters ??= SqlServerParametersFactory?.Build();
        result.SnowflakeParameters ??= SnowflakeParametersFactory?.Build();
        result.AmazonElasticsearchParameters ??= AmazonElasticsearchParametersFactory?.Build();
        result.AmazonOpenSearchParameters ??= AmazonOpenSearchParametersFactory?.Build();
        result.PostgreSqlParameters ??= PostgreSqlParametersFactory?.Build();
        result.AuroraParameters ??= AuroraParametersFactory?.Build();
        result.S3Parameters ??= S3ParametersFactory?.Build();
        result.TrinoParameters ??= TrinoParametersFactory?.Build();
        result.DatabricksParameters ??= DatabricksParametersFactory?.Build();
    }

} // End Of Class

